import { Link, useNavigate } from "react-router-dom";

function HomePage() {
  return (
    <>
      <h1>Home Page</h1>
      <p>
        Go to the <Link to="/products">Products Page</Link>
      </p>
      <button>Products</button>
    </>
  );
}

export default HomePage;
